#[StubsElementAvailable(from: "5.4", to: "8.0")]
final private function __clone(): void {}

/**
 * @since 8.1
 */
interface UnitEnum
{
    /**
     * The name of the enum case.
     * @var string
     */
    public readonly string $name = '';

    /**
     * @return static[]
     */
    #[Pure]
    public static function cases(): array {}
}

/**
 * @template T of int|string
 * @since 8.1
 */
interface BackedEnum extends UnitEnum
{
    /**
     * The value of the enum case.
     * @var T
     */
    public readonly int|string $value;

    /**
     * Translates a string or int into the corresponding Enum case.
     * @param T $value
     * @throws ValueError if there is no matching case defined
     * @throws TypeError
     * @return static
     */
    #[Pure]
    public static function from(int|string $value): static {}

    /**
     * Translates a string or int into the corresponding Enum case.
     * @param T $value
     * @return static|null
     */
    #[Pure]
    public static function tryFrom(int|string $value): ?static {}
}
